import React from 'react';

class Calender extends React.Component {

    render() {
        return (
            <div>
              <table className='calendertable'>
                  <tbody>
                  <tr>
                      <th>{'Sunday'}</th>
                      <th>{'Monday'}</th>
                      <th>{'Tuesday'}</th>
                      <th>{'Wednesday'}</th>
                      <th>{'Thursday'}</th>
                      <th>{'Friday'}</th>
                      <th>{'Saturday'}</th>
                  </tr>
                  </tbody>
              </table>
            </div>
          );
        }

}

export default Calender;
